pub enum MatrixComparisonResult<T, C, E> where T: Copy,
         C: ElementwiseComparator<T, E>, E: ComparisonFailure {
    Match,
    MismatchedDimensions {
        dim_x: (usize, usize),
        dim_y: (usize, usize),
    },
    MismatchedElements {
        comparator: C,
        mismatches: Vec<MatrixElementComparisonFailure<T, E>>,
    },
}

pub enum VectorComparisonResult<T, C, E> where T: Copy,
         C: ElementwiseComparator<T, E>, E: ComparisonFailure {
    Match,
    MismatchedDimensions {
        dim_x: usize,
        dim_y: usize,
    },
    MismatchedElements {
        comparator: C,
        mismatches: Vec<VectorElementComparisonFailure<T, E>>,
    },
}

pub enum Axes {

    /// The row axis.
    Row,

    /// The column axis.
    Col,
}

pub enum DiagOffset {

    /// The main diagonal of the matrix.
    Main,

    /// An offset above the main diagonal.
    Above(usize),

    /// An offset below the main diagonal.
    Below(usize),
}

pub enum ErrorKind {

    /// An argument did not uphold a necessary criteria for the function.
    InvalidArg,

    /// A failure to decompose due to some property of the data.
    DecompFailure,

    /// A failure due to some algebraic constraints not being met.
    AlgebraFailure,

    /// Tried to divide by zero
    DivByZero,
}

pub enum UlpComparisonResult {

    /// Signifies an exact match between two floating point numbers.
    ExactMatch,

    /// The difference in ULP between two floating point numbers.
    Difference(u64),

    /// The two floating point numbers have different signs,
    /// and cannot be compared in a meaningful way.
    IncompatibleSigns,

    /// One or both of the two floating point numbers is a NaN,
    /// in which case the ULP comparison is not meaningful.
    Nan,
}
